column8:
■製品特徴<br>1本で強力紫外線カット＋肌色補正するBBタイプのUVエッセンス。<br> 強力紫外線から肌をしっかり守り、日やけによるシミ・ソバカスを防ぎます。ハリ・弾力低下の原因となるUV-Aも防ぎます。<br>SPF50+なのに、重い圧迫感ゼロ。紫外線カット成分を、ぷるぷるのウォーターカプセルに閉じ込めて、「驚き」の軽さに。<br> 美容液成分（ヒアルロン酸＋ローヤルゼリーエキス＋シトラスmix＊）配合〈保湿成分〉。<br>くすみや色ムラを補正し、どんな肌色も明るくきれいに整えます。<br> 化粧下地効果で化粧くずれを防ぎます。<br> 落とすときは、メイク落としなどでよく洗ってください。<br>＊オレンジエキス、グレープフルーツエキス、レモンエキス<br>◆SPF50+／PA++++<br>◆みずみずしく香るフレッシュフルーツアロマ<br>◆アレルギーテスト済み（すべての方にアレルギーが起こらないというわけではありません。）<br><br>■成分<br>水、エタノール、メトキシケイヒ酸エチルヘキシル、酸化チタン、安息香酸アルキル（C12-15）、ビスエチルヘキシルオキシフェノールメトキシフェニルトリアジン、シクロペンタシロキサン、ジエチルアミノヒドロキシベンゾイル安息香酸ヘキシル、ステアリン酸ソルビタン、ステアリン酸グリセリル、（アクリル酸Na／アクリロイルジメチルタウリンNa）コポリマー、ステアリルアルコール、ジカプリン酸ネオペンチルグリコール、ポリソルベート60、セタノール、パルミチン酸デキストリン、イソヘキサデカン、水酸化Al、ジメチコン、ステアリン酸、カンテン、ポリシリコーン-9、ポリビニルアルコール、酸化鉄、ポリソルベート80、キサンタンガム、AMP、ステアロキシPGヒドロキシエチルセルローススルホン酸Na、グルタミン酸、ローカストビーンガム、ステアロイルメチルタウリンNa、マルトース、BG、PG、ヒアルロン酸Na、ローヤルゼリーエキス、オレンジ果実エキス、グレープフルーツ果実エキス、レモン果実エキス、フェノキシエタノール、メチルパラベン、EDTA-2Na、BHT、香料 <br><br>  ■使い方<br>〔顔用〕<br> 朝、肌のお手入れの最後に、適量(直径1.5cm程度)を少量ずつ肌にムラなく、ていねいになじませます。<br> 量が少ないと、充分な日やけ止め効果が得られません。<br> 効果を保つために、汗などをふいた後は、こまめにぬり直してください。<br> 落とすときは、メイク落としなどでよく洗ってください。<br><br>■ご注意<br><br>＜使用前＞<br>●特に肌の弱い方は使わないでください。<br>●除毛直後や肌に傷、はれもの、湿疹等異常のあるところには使わないでください。<br>  <br>＜使用時＞<br>●肌に異常が生じていないかよく注意して使用してください。肌に合わない時、使用中に赤み、はれ、かゆみ、刺激、色抜け（白斑等）や黒ずみ等の異常が出た時、直射日光があたって同様の異常が出た時は使用を中止し、皮フ科医へ相談してください。使い続けると症状が悪化することがあります。<br>●目に入らないように注意し、入った時は、すぐに充分洗い流してください。<br>●衣類等につかないよう充分ご注意ください。つけた後のお肌が、衣類や車のシート等とこすれた時などは、衣類等に白く残ることがあります。<br>●衣類等についた時は、すぐに洗剤でていねいにつまみ洗いしてください。また、ついた部分がピンク等に変色（着色）する場合がありますので、塩素系漂白剤のご使用は避けてください。<br>●UVカット成分を含んだウォーターカプセルが白い粒として見えることがありますが、品質などに問題はありません。 <br><br>＜保管＞<br>●高温の場所、直射日光のあたる場所には置かないでください。<br>●子供や認知症の方などの誤飲等を防ぐため、置き場所にご注意ください。<br>  <br><br>■お問い合わせ先<br>こちらの商品につきましての質問や相談につきましては、当店（ドラッグピュア）または下記へお願いします。<br>花王株式会社<br>ヘアケア・スキンケア用品<br>TEL:0120-165-692<br> 受付時間：9：00-17：00(土、日、祝日を除く)<br><br><br><br>広告文責：株式会社ドラッグピュア<br>作成：201602SN<br>神戸市北区鈴蘭台北町1丁目1-11-103<br>TEL:0120-093-849<br>製造販売者：花王株式会社<br>東京都墨田区文花2-1-3<br>区分：スキンケア化粧品・日本製<br>文責：登録販売者　松田誠司<br><br><br><font